import React from "react";
import { BottomNavigation, BottomNavigationAction, List, ListItem } from "@material-ui/core";

import './footer.css';

import instagram_icon from '../../assets/img/icons/instagram_icon.webp';
const Footer = () => {
    const [value, setValue] = React.useState('recents');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (

        <>
            <BottomNavigation xs={{ width: 500 }} value={value} onChange={handleChange} className={`footer`}>

                <BottomNavigationAction label='Github' value='recents' icon={instagram_icon}/>
            
            </BottomNavigation>

                


        </>
    )
}

export default Footer;
